Only Episode 1 is new in this pack. If you already have Episode 2 and 3, you don't need to get them again. Just move them here.

The goal was to make the movies feel better with cutting as little as possible. Awkward dialogs and weak moments have been removed and some scenes have been rearranged. 

The trilogy was edited in reverse. This project started 2 years ago with Episode III and Episode I was the last movie to be re-edited.
